contracts/BacaTulis.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

import "./UppercaseString.sol";

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */
contract BacaTulis {

    string myName;
    uint256 number;

    UppercaseString us = new UppercaseString();

    /**
     * @dev Store value in variable
     * @param num value to store
     */
    function store(uint256 num) public {
        number = num;
    }

    /**
     * @dev Return value 
     * @return value of 'number'
     */
    function retrieve() public view returns (uint256){
        return number;
    }

    function setName(string calldata name) public {
        myName = name;
    }

    function getName() public view returns (string memory) {
        return us.toUpperCase(myName);
    }

    function kalikan(uint256 angka) public pure returns (uint256) {
        return angka * 4;
    }
}

contracts/UppercaseString.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

contract UppercaseString {
    function toUpperCase(string memory str) public pure returns (string memory) {
        bytes memory bStr = bytes(str);
        for (uint i = 0; i < bStr.length; i++) {
            if (bStr[i] >= 0x61 && bStr[i] <= 0x7A) {
                bStr[i] = bytes1(uint8(bStr[i]) - 32);
            }
        }
        return string(bStr);
    }
}

